import React from 'react';

class AddProject extends React.Component {
  //props is not passed when function called. resort to the default props
  //only allowed in class component 
  static defaultProps = {
    categories: ['Web Design', 'Web Development', 'Mobile Development']
  }

  handleSubmit(e) {
    console.log(e);
  }    

  render() {
    //map function put here to allow access from below
    let categoryOptions = this.props.categories.map(category => {
      return <option value={category} name={category}>{category}</option>
    });

    return (  
      <div>
        <h3>Add Projects</h3>
        <form>
          <div>
            <label>Title</label>
            <input type='text' name='input' />
          </div>
          <div>
            <label>Category</label>
            <select name='category'>
              {categoryOptions}
            </select>
          </div>
          <input type='submit' value='submit' onSubmit={this.handleSubmit} />
        </form>
      </div>
    );  
  }  	

}

export default AddProject;
